import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "../containers/Home/index";
import { ConfigProvider, theme, } from "antd";
import { useState } from "react"

function App() {
  const [whiteMode, setWhiteMode] = useState(true)

  return (
    <ConfigProvider theme={{ algorithm: isDark ? theme.darkAlgorithm : theme.defaultAlgorithm }}>

      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home fill={""} setWhiteMode={setWhiteMode} />} />
          <Route path="/calendar" element={<Home fill={"calendar"} setWhiteMode={setWhiteMode} />} />
          <Route path="/college" element={<Home fill={"college"} setWhiteMode={setWhiteMode} />} />
          <Route path="/contentcreator" element={<Home fill={"contentcreator"} setWhiteMode={setWhiteMode} />} />
          <Route path="/developer" element={<Home fill={"developer"} setWhiteMode={setWhiteMode} />} />
          <Route path="/meals" element={<Home fill={"meals"} />} setWhiteMode={setWhiteMode} />
          <Route path="/weather" element={<Home fill={"weather"} setWhiteMode={setWhiteMode} />} />
        </Routes>
      </BrowserRouter >
    </ConfigProvider>
  );
}

export default App;
